import React from 'react'
import { Link } from 'react-router-dom';
import Github from './img/github.png'
import LinkedIn from './img/317750_linkedin_icon.png'
import Instagram from './img/instagram.png'
import './index.css'

const Footer = () => {
  return (
    <>
      <footer className='footer mt-5 mx-2 mb-1 d-flex'>
        <h1 className="text-primary d-flex">Nitin_Patil</h1>
        <Link to=""><img className='bg-light m-1 fo_img' src={Github} alt="Github" /></Link>
        <Link to=""><img className='bg-light m-1 fo_img' src={LinkedIn} alt="LinkedIn" /></Link>
        <Link to=""><img className='bg-light m-1 fo_img' src={Instagram} alt="Instagram" /></Link>
      </footer>
    </>
  )
}

export default Footer;
